import React from 'react';
import { Form, Input, Button, Checkbox, Row, Col } from 'antd';


export default function Login() {
    return (
        <Row justify="center">
            <Form>
                <Row>
                    <Form.Item
                        label="Username"
                        name="username"
                        rules={[{ required: true, message: 'Please input your username!' }]}
                    >
                        <Input />
                    </Form.Item>
                </Row>
            </Form>
        </Row>
    )
}
